{
  "advertisements": [
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "1. Eine gewisse Person von Stand suchet einen Hofmeister vor ihren Sohn, der die lateinische und französische Sprache, wie auch die Mathematic, Geographie und Historie wohl verstehet, und von gutem Leben ist. Wer Lust hat, beliebe sich zu melden bey dem Buchbinder in der langen Gassen."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "2. Ein Kaufmann hat einen guten Lehr-Jungen nötig, der schreiben und rechnen kann. Die Meldung bey demselben in der Kärntner-Strassen."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "3. Eine ehrliche Person suchet einen Dienst als Koch bey einem Herrn. Die Meldung bey der alten Fleischbank."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "4. Ein junger Mensch, der die französische und italienische Sprache verstehet, suchet einen Dienst bey einem Kaufmann. Die Meldung bey dem Kaffee-Haus in dem Graben."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "5. Es werden verlangt zwey gute Pferde vor eine Kutsche. Wer solche hat, melde sich bey dem Wirth in der Wieden."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "6. Es ist verloren gegangen ein silberner Löffel mit einem Wappen. Wer solchen findet, beliebe ihn zu bringen bey dem Goldschmied in der Kärntner-Strassen, soll redlich belohnet werden."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "7. Es ist zu verkaufen ein gutes Clavier von Nürnberg. Zu erfragen bey dem Orgelmacher in der Singer-Strassen."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "8. Eine Wittwe vermiethet eine schöne Wohnung in der innern Stadt. Die Meldung bey ihr selbst in der Rotten-Thurm-Strassen."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "9. Es werden offeriret allerhand gute Weine, französische und rheinische. Zu finden bey dem Weinschenken in der Freyung."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "10. Ein Buchbinder suchet Arbeit, ist geschickt in allem, was zu seinem Handwerk gehört. Die Meldung bey ihm in der Leopoldstadt."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "11. Es ist zu vermiethen ein Haus in der Vorstadt, mit einem schönen Garten. Zu erfragen bey dem Eigenthümer in der Josephstadt."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "12. Ein Schneider suchet Arbeit, ist geschickt in der französischen Mode. Meldung bey ihm in der Alser-Vorstadt."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "13. Es werden verlangt gute Diener-Mädchen. Meldung bey der Frau in der Rossau."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "14. Ein Apotheker hat einen Lehr-Jungen nötig. Meldung bey ihm in der innern Stadt."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "15. Es ist verloren ein goldener Ring mit einem Diamant. Der Finder wird belohnet bey dem Juwelier in dem Graben."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "16. Zu verkaufen ein schöner Wagen mit Pferden. Zu erfragen bey dem Kutscher in der Wieden."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "17. Eine junge Person suchet einen Dienst als Kammer-Jungfer. Meldung bey der Frau in dem Graben."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "18. Es werden verlangt gute Kühe vor Milch. Wer solche hat, melde sich bey dem Bauer in der Leopoldstadt."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "19. Es ist verloren ein Taschen-Buch mit Geld. Der Finder wird gut belohnet bey dem Kaufmann in der Freyung."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "20. Ein ein Musikus suchet einen Dienst bey einem Herrn. Er spielt Violine und Clavier. Meldung bey dem Kaffeehaus in der Graben."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "21. Es werden offeriret neue Kleider nach der neuesten Mode. Zu finden bey dem Schneider in der Kärntnerstrasse."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "22. Eine Wittib vermiethet Zimmer an ehrliche Personen. Meldung bey ihr in der Josephstadt."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "23. Es ist zu verkaufen ein gutes Pferd. Zu erfragen bey dem Stallmeister in der Wieden."
    },
    {
      "date": "1711-01-01",
      "tags_section": null,
      "text": "24. Ein Lehrer suchet Schüler in der Musik. Meldung bey ihm in der innern Stadt."
    }
  ]
}
